const author  = 'Dyrtheaststar ID';
const version = '1.0.0';
const api     = 'https://artakula-api.dapuntaratya.com';
// const api = 'http://127.0.0.1:5000';

document.getElementById('version').innerHTML = `v${version} @ ${author}`;

function errorResponse(text) {
    const box = document.getElementById('response-login');
    box.innerText = text;
}

// Submit Route

document.getElementById('username').addEventListener('keydown', function(event) {
    if (event.key === 'Enter') {
        event.preventDefault();
        document.getElementById('password').focus();
    }
});

document.getElementById('password').addEventListener('keydown', function(event) {
    if (event.key === 'Enter') {
        event.preventDefault();
        nextSubmit('signin');
    }
});

async function nextSubmit(route) {
    const username_element = document.getElementById('username');
    const password_element = document.getElementById('password');
    const username = username_element.value.replace(/\s/g, '') === "" ? null : username_element.value.replace(/\s/g,'').toLowerCase();
    const password = password_element.value.replace(/\s/g, '') === "" ? null : password_element.value.replace(/\s/g,'').toLowerCase();
    if (username == null || password == null) {
        errorResponse('Username Atau Password Salah');
    }
    else if (username.length < 5 || password.length < 8) {
        errorResponse('Username Minimal 5 Huruf Dan Password Minimal 8 Digit');
    }
    else {
        if (route == 'signin') {await signIn(username, password);}
        else if (route == 'signup') {await signUp(username, password);}
    }
    username_element.value = '';
    password_element.value = '';
}

async function signIn(username, password) {
    const sign = generateSignPayload(username, password);
    const url  = `${api}/signin?value=${sign}`;
    try {
        const response = await fetch(url, {
            method: 'GET',
            mode: 'cors',
            headers: {'Content-Type':'application/json', 'Access-Control-Allow-Origin':'*'}
        });
        const result = await response.json();
        if (result.status == 'success') {
            setCookie('key', result.key);
            checkCookie('key');
        }
        else {
            errorResponse(result.message);
        }
    }
    catch (e) {
        console.log(e);
    }
}

async function signUp(username, password) {
    const sign = generateSignPayload(username, password);
    const url  = `${api}/signup?value=${sign}`;
    try {
        const response = await fetch(url, {
            method: 'GET',
            mode: 'cors',
            headers: {'Content-Type':'application/json', 'Access-Control-Allow-Origin':'*'}
        });
        const result = await response.json();
        if (result.status == 'success') {
            alert('Berhasil sign up, silahkan sign in')
        }
        else {
            errorResponse(result.message);
        }
    }
    catch (e) {
        console.log(e);
    }
}

// Cookie

function deleteCookie(name) {
    document.cookie = name + '=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;';
}

function setCookie(name, value) {
    let expires = "";
    const hours = 8;
    if (hours) {
        const date = new Date();
        date.setTime(date.getTime() + (hours * 60 * 60 * 1000));
        expires = "; expires=" + date.toUTCString();
    }
    document.cookie = name + "=" + (value || "") + expires + "; path=/";
}

function getCookie(name) {
    const nameEQ = name + "=";
    const ca = document.cookie.split(';');
    for (let i = 0; i < ca.length; i++) {
        let c = ca[i];
        while (c.charAt(0) === ' ') c = c.substring(1, c.length);
        if (c.indexOf(nameEQ) === 0) return c.substring(nameEQ.length, c.length);
    }
    return null;
}

function checkCookie() {
    const cookie = getCookie('key');
    if (cookie) {
        window.location.href = window.location.origin + '/';
    }
    else {
        deleteCookie('key');
    }
}

checkCookie()

